import React from 'react';
import Header from "./Header";
import Preloader from "../assetss/common/Loader/Loader";
import {connect} from "react-redux";
import {LogOutThunk} from "../../data/AuthReducer";
import {GetProfileSelector} from "../../data/ProfileSelectors";


class HeaderContainer extends React.Component {

    render() {
        return <>
        {this.props.IsFetching ? <Preloader/> :null}
          <Header {...this.props} />
          </>
    }

}
let MapStateToProps = (state) => ({
    IsFetching : state.Auth.IsFetching,
    IsLogined:state.Auth.IsLogined,
    login:state.Auth.login,
    UserName: GetProfileSelector(state)
})

export default HeaderContainer = connect(MapStateToProps, {LogOutThunk})(HeaderContainer);
